import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const Testinput = () => {
  const { className,totalMarks } = useParams();
  const [testdata, setTestdata] = useState([]);

  const fetchInfo = async (className) => {
    try {
      const response = await fetch(`http://localhost:5000/classdata?classNumber=${className}`);
      const data = await response.json();

      // Ensure data is an array before setting state
      if (Array.isArray(data)) {
        setTestdata(data);
      } else {
        console.error("Data fetched is not an array:", data);
        setTestdata([]);
      }
    } catch (error) {
      console.log("Error in fetching data", error);
    }
  };

  useEffect(() => {
    fetchInfo(className);
  }, [className]);

  return (
    <div className='student-container'>
      <div className="list-product">
        <p>All Student List of {className}</p>
        <div className="list-format-main">
          <p>Student name</p>
          <p>RollNo</p>
          <p>TatalMarks:{totalMarks}</p>
        </div>
        <div className="listproduct-allproduct">
          <hr />
          {testdata.map((product, index) => (
            <div key={index} className='list-format-main listproduct-format'>
              <p>{product.name}</p>
              <p>{product.RollNo}</p>
             <input type='number'/>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Testinput;
